export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},BpXOyiRUw9:{data:{id:1287,attributes:{imdbId:"tt0401445",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BODE4NDY3MjUxNV5BMl5BanBnXkFtZTYwMTMwODI3._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"},{Source:"Rotten Tomatoes",Value:"25%"},{Source:"Metacritic",Value:"47\u002F100"}],item_lang:{data:{id:1950,attributes:{title:e,plot:"After years of no contact with his Uncle Henry, London banker and bond trader Max Skinner learns that Henry has died intestate, so Max inherits a château and vineyard in Provence. Max spent part of his childhood there, learning maxims and how to win and lose, and honing his killer instinct (at chess, which serves him well in finance). Max goes to France intent on selling the property. He spends a few days there, getting the property ready to show. Memories, a beautiful woman, and a young American who says she's Henry's illegitimate daughter interrupt his plans. Did Max the boy know things that Max the man has forgotten?",slug:"a-good-year"}}},books:{data:[{id:7066,attributes:{title:e,description:i,thumbnail:j,authors:[a],firstBook:true,published:k,publisher:c,subtitle:f}},{id:7067,attributes:{title:"My Twenty-Five Years in Provence",description:"From the moment Peter Mayle and his wife, Jennie, uprooted their lives in England and crossed the Channel permanently, they never looked back. Here the beloved author of A Year in Provence pays tribute to the most endearing and enduring aspects of his life in France—the charming and indelible parade of village life, the sheer beauty, the ancient history. He celebrates the café and lists some of his favorites; identifies his favorite villages, restaurants, and open-air markets; and recounts his most memorable meals. A celebration of twenty-five years of Provençal living—of lessons learned and changes observed—with his final book Mayle has crafted a lasting love letter to his adopted home, marked by his signature warmth, wit, and humor.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=p1lJDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2018-06-26",publisher:c,subtitle:"Reflections on Then and Now"}},{id:7068,attributes:{title:e,description:i,thumbnail:j,authors:[a],firstBook:d,published:k,publisher:c,subtitle:f}},{id:7069,attributes:{title:"A Year in Provence",description:"NATIONAL BESTSELLER • In this witty and warm-hearted account, Peter Mayle tells what it is like to realize a long-cherished dream and actually move into a 200-year-old stone farmhouse in the remote country of the Lubéron with his wife and two large dogs. He endures January's frosty mistral as it comes howling down the Rhône Valley, discovers the secrets of goat racing through the middle of town, and delights in the glorious regional cuisine. A Year in Provence transports us into all the earthy pleasures of Provençal life and lets us live vicariously at a tempo governed by seasons, not by days.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WWKvuJyaa0EC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2010-05-19",publisher:c,subtitle:f}},{id:7070,attributes:{title:"\"What's Happening To Me?\"",description:"For more than twenty years, the internationally bestselling team behind Where Did I Come From? has helped millions of parents and children talk about the facts of life in a straightforward yet lighthearted way that is respectful of young people’s natural intelligence. Warmly and relatably illustrated throughout, What’s Happening to Me? creates a safe space where families can talk about the physical and emotional changes that happen during puberty and adolescence, answering the questions that kids ask most often. Why is my chest getting bumpy? What's a wet dream? What's a period? Why is my voice acting so funny? Why do I get pimples? What's an erection? Why am I getting hairy? Why is mine not like his? This book answers the big questions, and explains the big changes. One look at the illustrations will tell you that this is not a dull medical textbook but rather it presents the facts of puberty, and it presents them with honesty, sympathy and a sense of humor. If you’ve been wondering how to have this talk with your children, look no further for a trusted resource that will give you the tools you need to share this critical information sensitively and factually. “You can't deny Mayle's talent for translating adult experience into child-level concepts.” —Kirkus Reviews",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7cNQCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"2000-08-01",publisher:"Lyle Stuart",subtitle:"The Classic Illustrated Children's Book on Puberty"}}]}}},meta:{}}},prerenderedAt:1681377334351}}("Peter Mayle","movie","Vintage",null,"A Good Year","","series",1,"A delightful, best-selling tale about the business and pleasure of wine, adapted into a Ridley Scott movie starring Russell Crowe and Marion Cotillard. Max Skinner has recently lost his job at a London financial firm and just as recently learned that he has inherited his late uncle’s vineyard in Provence. On arrival he finds the climate delicious, the food even better, and two of the locals ravishing. Unfortunately, the wine produced on his new property is swill. Why then are so many people interested in it? Enter a beguiling Californian who knows more about wine than Max does—and may have a better claim to the estate. Fizzy with intrigue, bursting with local color and savor, A Good Year is Peter Mayle, beloved author of A Year in Provence, at his most entertaining.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OpKu4i1F_awC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2004-06-01"))